import React from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Typography from '@material-ui/core/Typography';
import CardActions from '@material-ui/core/CardActions';
import Button from '@material-ui/core/Button';
import { IMAGES } from 'shared/constants/stringConstantsSelectors';
import Modal from 'components/common/displayData/modal/modal';

export const Item = props => {

    const {
        id,
        imageURL,
        name,
        type,
    } = props.item;

    const imageSource = props.realImages ?  imageURL : IMAGES.FILL_MURRAY;

    const rawText = <div>{JSON.stringify(props.item, undefined, '\t')}</div>

    return (
        <div>
            { props.item ? (
                <Card style={{ margin: 5 }}>
                    <CardMedia 
                        style={{ paddingTop: '60%', height: '250px', textAlign: 'top' }} 
                        image={imageSource}
                        title={id}
                    />
                    <CardContent>
                        <Typography gutterBottom variant='h5' component='h2'>{name}</Typography>
                        <Typography component='p'>{type}</Typography>
                    </CardContent>
                    <CardActions>
                        <Button size='small' color='primary' href={imageURL} target='_blank'>Image</Button>
                        <Modal buttonName={'Raw'} text={JSON.stringify(props.item, undefined, '\t')}/>
                    </CardActions>
                </Card>
            ) : null}
        </div>
    );
};
